import React from 'react'

const NameList = () => {
    const names = ['akash','batash','sagar'];
    const persons = [
        {   
            id:1,
            name:'akash'
        },
        {
            id:2,
            name:'sagar',
        },
    ];
    const personList =  persons.map(person => <p>My id is {person.id} and i am {person.name}</p>)
    return (
        <div>
            {
             personList  
            }
        </div>
    )
}

export default NameList
